pragma solidity ^0.5.16;
pragma experimental ABIEncoderV2;

import "./GeneralStorage.sol";

contract FactoryInfo  {
    GeneralStorage generalStorage;

    string  inFactoryTime = "inFactoryTime";
    string  carNo = "carNo";
    string  carCert = "carCert";
    string  driver = "driver";
    string  driverCert = "driverCert";
    string  inWeight = "inWeight";

    string  inPicHash = "inPicHash";

    string  qcLevel = "qcLevel";
    string  qcPerson = "qcPerson";

    string  outFactoryTime = "outFactoryTime";
    string  outPicHash = "outPicHash";
    string  outWeight = "outWeight";


    string  fundPicHash = "fundPicHash";
    string  fundId = "fundId";
    string  fundValue = "fundValue";

    string  contractHash = "contractHash";

    function setStorageAddress(address _addr) public{
        generalStorage = GeneralStorage(_addr);
    }

    function setInFactory(bytes memory _id,bytes memory _date,bytes memory _cano,
                            bytes memory _cacert,bytes memory _driver,
                            bytes memory _drivercert,
                            bytes memory _weight) public{
        generalStorage.setStorage(_id,bytes(inFactoryTime),_date);
        generalStorage.setStorage(_id,bytes(carNo),_cano);
        generalStorage.setStorage(_id,bytes(carCert),_cacert);
        generalStorage.setStorage(_id,bytes(driver),_driver);
        generalStorage.setStorage(_id,bytes(driverCert),_drivercert);
        generalStorage.setStorage(_id,bytes(inWeight),_weight);
    }

    function getInFactoryInfo(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){
        bytes[] memory stages = new bytes[](6);
        bytes[] memory values = new bytes[](6);
        string[6] memory list = ["inFactoryTime","carNo","carCert","driver","driverCert","inWeight"];
        for (uint i = 0; i < 6; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }

    function setInPic(bytes memory _id,bytes memory _pic) public{
        generalStorage.setStorage(_id,bytes(inPicHash),_pic);
    }

    function getInPic(bytes memory _id) public view returns(bytes memory){
        address from;
        bytes memory idinfo;
        bytes memory stage;
        bytes memory value;
        (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(inPicHash));
        return value;
    }

    function setContractHash(bytes memory _id,bytes memory _contracthash) public{
        generalStorage.setStorage(_id,bytes(contractHash),_contracthash);
    }

    function getContractHash(bytes memory _id) public view returns(bytes memory){
        address from;
        bytes memory idinfo;
        bytes memory stage;
        bytes memory value;
        (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(contractHash));
        return value;
    }

    function setQc(bytes memory _id,bytes memory _qclevel,bytes memory _qcperson) public{
        generalStorage.setStorage(_id,bytes(qcLevel),_qclevel);
        generalStorage.setStorage(_id,bytes(qcPerson),_qcperson);
    }

    function getQc(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){
        bytes[] memory stages = new bytes[](2);
        bytes[] memory values = new bytes[](2);
        string[2] memory list = ["qcLevel","qcPerson"];
        for (uint i = 0; i < 2; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }

    function setOutFactory(bytes memory _id,bytes memory _date,bytes memory _weight) public{
        generalStorage.setStorage(_id,bytes(outFactoryTime),_date);
        generalStorage.setStorage(_id,bytes(outWeight),_weight);
    }

    function getOutFactoryInfo(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){
        bytes[] memory stages = new bytes[](2);
        bytes[] memory values = new bytes[](2);
        string[2] memory list = ["outFactoryTime","outWeight"];
        for (uint i = 0; i < 2; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }

    function setOutPic(bytes memory _id,bytes memory _pic) public{
        generalStorage.setStorage(_id,bytes(outPicHash),_pic);
    }

    function getOutPic(bytes memory _id) public view returns(bytes memory){
        address from;
        bytes memory idinfo;
        bytes memory stage;
        bytes memory value;
        (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(outPicHash));
        return value;
    }

     function setFund(bytes memory _id,bytes memory _pichash,bytes memory _fundid,bytes memory _fundvalue) public{
        generalStorage.setStorage(_id,bytes(fundPicHash),_pichash);
        generalStorage.setStorage(_id,bytes(fundId),_fundid);
        generalStorage.setStorage(_id,bytes(fundValue),_fundvalue);
    }

    function getFund(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){
        bytes[] memory stages = new bytes[](3);
        bytes[] memory values = new bytes[](3);
        string[3] memory list = ["fundPicHash","fundId","fundValue"];
        for (uint i = 0; i < 3; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }

    function getInfo(bytes memory _id) public view returns(bytes[] memory,bytes[] memory){

        bytes[] memory stages = new bytes[](16);
        bytes[] memory values = new bytes[](16);

        string[16] memory list = ["inFactoryTime","carNo","carCert","driver","driverCert",
        "inWeight","inPicHash","qcLevel","qcPerson","outFactoryTime","outPicHash","outWeight",
        "fundPicHash","fundId","fundValue","contractHash"];

        for (uint i = 0; i < 16; i++) {
            address from;
            bytes memory idinfo;
            bytes memory stage;
            bytes memory value;
            (from,idinfo,stage,value) = generalStorage.getStorage(_id,bytes(list[i]));
            stages[i] = stage;
            values[i] = value;
        }
        return (stages,values);
    }
}
